export default function Acknowledgements() {
    return (

        <section id="resume" className="ack-section">
            <span className="welcome--title--colour">
            <h1 className="welcome--section--title">
            <span className="welcome--title--colour">
              <h3> Acknowledgements </h3></span> {" "}
          </h1>
          </span>
          <br/>

                <p className="ack--desc text-muted mb-2">I would like to thank, Kate McRoberts and Anne-Marie Zawadzki, my co-op coordinators from the University of Guelph, who gave me valuable advice on how to accomplish my goals, aided me with conflicts and addressed any concerns or questions I had throughout my work terms.</p> 
    </section>

    );
}
